import { initialState } from './initialState';

function selectedProgramReducer(state = initialState.selectedProgram, action) {
  switch (action.type) {
    case 'SET_SELECTED_PROGRAM':
      return {
        ...state,
        selectedProgram: action.payload
      };

    default:
      return state;
  }
}

export { selectedProgramReducer };
